void plot_letter(char, int);
void plot_pixel(int, int, short int);
void plot_background();
void draw_board();
void choose_random_word();
void find_next_index();
void display_result(char*);
void plot_number(int);
void play_audio();
// unsigned char interrupt_handler(unsigned char);
void interrupt_handler();
// unsigned char interval_PS2_ISR(unsigned char);
void interval_PS2_ISR();
void HEX_PS2();


// when the keyboard is pressed by the user
unsigned char keyboard_polling(unsigned char check) {
  unsigned char key = 0;
  int PS2_data, RVALID;

  // get the RVALID bit
  PS2_data = *PS2_ptr;
  RVALID = (PS2_data & 0x8000);

  // if the RVALID bit is 1
  if (RVALID) {
    // get the hex value of the keyboard press
    key = PS2_data & 0xFF;

    // if the key was released
    if (key != 0xF0) {
      check = key;
      return check;
    }

    // check through the alphabets and see if the key was pressed
    for (int i = 0; i < NUM_ALPHABET; i++) {
      if (check == ps2_key_hex[i]) {
        // if a key was pressed then show the letter on the VGA
        show_letter(alphabet[i]);
      }
    }
    // if enter is pressed
    if (check == ps2_key_hex[NUM_ALPHABET]) {
      enter_press();
    }
    // if backspace is pressed
    if (check == ps2_key_hex[NUM_ALPHABET + 1]) {
      backspace_press();
    }
  }

  return check;
}

// show the letter on the VGA display
void show_letter(char character) {
  // if user has not pressed enter yet
  if (row != enter) {
    return;
  }
  // plot the letter that the user inputted
  plot_letter(character, col);

  // swap front and back buffers on VGA vertical sync
  wait_for_vsync();
  // new back buffer
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);

  // plot the letter that the user inputted after buffer swap
  plot_letter(character, col);

  // add the character to the the user guess string
  guess[col] = character;

  // get the next row and column index
  find_next_index();
}

// display the result word in game end/scored screen
void display_result(char* result) {
  for (int i = 0; i < WORD_LENGTH; i++) {
    if (game_scored)
      background_color[i] = GREEN;
    else
      background_color[i] = LIGHT_GRAY;
  }
  row = 3;
  col = 0;
  for (int i = 0; result[i] != '\0'; i++) {
    plot_letter(result[i], i);
    col++;
    background_color[i] = LIGHT_GRAY;  // reset to default
  }
}

// if the backspace key is pressed
void backspace_press() {
  // go to the previous column when the backspace is pressed
  if (col != 0) {
    col--;
  }
  // if the current character is the first character of the word
  else {
    // go to the previous row and column after the user has inputted the last
    // letter
    if (enter != row && col == 0) {
      col = 4;
      // only decrement row if the row is not the first row
      if (row != 0) {
        row--;
      }
    }
  }

  // plot the blank background
  plot_background();

  // swap front and back buffers on VGA vertical sync
  wait_for_vsync();
  // new back buffer
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);

  // plot the blank background after buffer swap
  plot_background();
}

// if the enter key is pressed
void enter_press() {
  if (on_main_screen) {
    enter = 0;
    row = 0;
    col = 0;
    on_main_screen = false;
    on_help_screen = true;
    draw_board();
  } else if (on_help_screen) {
    on_help_screen = false;
    draw_board();
  } else if (game_end) {
    game_end = false;
    on_main_screen = true;
    draw_board();
  } else if (game_scored) {
    game_scored = false;
    on_main_screen = true;
    row = 3;
    draw_board();
  } else {
      if (row == 0 && col == 0) {
        return;
    }
    // return if Enter pressed when word is not finished
    if (col != 0) {
      return;
    }
    // return if user presses enter on the first column
    if (row == enter) {
      return;
    }
    // increment the current row that the user pressed enter on
    enter = (enter + 1) % 6;

    // print the guess on the JTAG UART
    printf("guess: %s\n", guess);
    printf("answer: %s\n", answer);

    // if the guess matches the answer, game ends and return main screen
    if (strcmp(guess, answer) == 0) {
      game_scored = true;
      score++;
      printf("Current Score: %d\n", score);
      printf("Now game scored is %d\n", game_scored);

      HEX_PS2();
    }

    // compare the answer and the guess
    for (int i = 0; i < WORD_LENGTH; i++) {
      int status = WRONG;
      for (int j = 0; j < WORD_LENGTH; j++) {
        // if the two characters match in the answer and guess
        if (answer[j] == guess[i]) {
          // if the position is the same
          if (i == j) {
            status = CORRECT;
          } else {
            // if the position is not the same
            if (status != CORRECT) {
              status = PARTIALLY_CORRECT;
            }
          }
        }
      }
      // 1. if status is WRONG, bg = GRAY
      // 2. if PARTIALLY CORRECT, bg = YELLOW
      // 3. if CORRECT, bg = GREEN
      if (status == WRONG) {
        background_color[i] = GRAY;
      }
      if (status == PARTIALLY_CORRECT) {
        background_color[i] = YELLOW;
      }
      if (status == CORRECT) {
        background_color[i] = GREEN;
      }
    }

    // decrement the row since when the user presses enter the row goes to the
    // next one
    if (row != 0) {
      row--;
    } else {  // user has used all 6 tries
      row = 5;
      game_end = true;
    }
    // change column to the start of the word
    col = 0;
    // plot all the letters again with the background color that was found
    for (int i = 0; i < WORD_LENGTH; i++) {
      // plot the letter with the corresponding background color
      plot_letter(guess[i], i);

      // swap front and back buffers on VGA vertical sync
      wait_for_vsync();
      // new back buffer
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);

      // plot the letter with the corresponding background color after buffer
      // sawp
      plot_letter(guess[i], i);

      // go to the next letter
      col++;

      // re-initialize the background color to light gray
      background_color[i] = LIGHT_GRAY;
    }
    // re-increment the row by 1
    row = (row + 1) % 6;
    // change column to the start of the word
    col = 0;

    if (game_end) {
      printf("the answer was: %s\n", answer);
      draw_board();
      display_result(answer);
      plot_number(score);
      // choose random word from the word list
      choose_random_word();
    } else if (game_scored) {
      printf("word matched: %s\n", guess);
      draw_board();
      display_result(answer);
      plot_number(score);
      // choose random word from the word list
      choose_random_word();
    }
  }
}

// wait until the S bit goes to 0
void wait_for_vsync() {
  int status;
  // start the synchronization process
  // write 1 into front buffer address register
  *pixel_ctrl_ptr = 1;
  // read the status register
  status = *(pixel_ctrl_ptr + 3);

  // polling loop waiting for S bit to go to 0
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }
}

// plot the letter on the VGA display
void plot_letter(char character, int index) {
  /*
  |--------------|    |--------------|    |--------------|    |--------------|
  |--------------| |              |    |              |    |              |    |
  |    |              | |              |    |              |    |              |
  |              |    |              | |      J       |    |       I      |    |
  M      |    |       I      |    |       N      | |              |    | |    |
  |    |              |    |              | |              |    |              |
  |              |    |              |    |              |
  |--------------|    |--------------|    |--------------|    |--------------|
  |--------------|

  |--LETTERSIZE--|                 ->|    |<-
     (20 pixels)                     MARGIN (2 pixels)
  */

  // loop through the LETTERSIZE + MARGIN for row and column
  for (int i = start_row + row * LETTER_SIZE + row * MARGIN;
       i < LETTER_SIZE + start_row + row * LETTER_SIZE + row * MARGIN; ++i) {
    for (int j = start_col + col * LETTER_SIZE + col * MARGIN;
         j < LETTER_SIZE + start_col + col * LETTER_SIZE + col * MARGIN; ++j) {
      // 1. char - (int)'A': 'B'-'A' would give 1, which is position of 'B' in
      // array if 'A' is at 0
      // 2. (i - row * LETTER_SIZE - start_row - row * MARGIN) * LETTER_SIZE:
      // adjust row index 'i' by subtracting start row & additional offsets
      // 3. (j - col * LETTER_SIZE - start_col - col * MARGIN): adjust column
      // index 'j' in the same way as #2.
      int color = letter[character - (int)'A']
                        [(i - row * LETTER_SIZE - start_row - row * MARGIN) *
                             LETTER_SIZE +
                         (j - col * LETTER_SIZE - start_col - col * MARGIN)];

      // if the pixel color is black then use the background color instead
      if (color == BLACK) {
        plot_pixel(j, i, background_color[index]);
      } else {
        // if darkmode is on then plot the letters black
        if (darkmode) {
          plot_pixel(j, i, BLACK);
        }
        // if darkmode is off then plot the letters with its original color
        else {
          plot_pixel(j, i, color);
        }
      }
    }
    // if the user has pressed enter
    if (row != enter) {
      // timer used for smooth transition
      int timer = 2500;
      while (timer > 0) {
        timer--;
      }

      // swap front and back buffers on VGA vertical sync
      wait_for_vsync();
      // new back buffer
      pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    }

    // redraw the letter after the buffer swap
    for (int j = start_col + col * LETTER_SIZE + col * MARGIN;
         j < LETTER_SIZE + start_col + col * LETTER_SIZE + col * MARGIN; ++j) {
      int color = letter[character - (int)'A']
                        [(i - row * LETTER_SIZE - start_row - row * MARGIN) *
                             LETTER_SIZE +
                         (j - col * LETTER_SIZE - start_col - col * MARGIN)];

      // if the pixel color is black then use the background color instead
      if (color == BLACK) {
        plot_pixel(j, i, background_color[index]);
      } else {
        // if darkmode is on then plot the letters black
        if (darkmode) {
          plot_pixel(j, i, BLACK);
        }
        // if darkmode is off then plot the letters with its original color
        else {
          plot_pixel(j, i, color);
        }
      }
    }
  }
}

// plot the score at the game end/scored screens
void plot_number(int score) {
  char score_str[10];               // Large enough for any int value
  sprintf(score_str, "%d", score);  // Convert the score into a string

  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  // Iterate over each character in the score string
  for (int num_index = 0; score_str[num_index] != '\0'; num_index++) {
    int digit = score_str[num_index] - '0';  // Convert char to int (0-9)
    const short int* digit_array =
        scores[digit];  // Get the digit's bitmap from the 'scores' array

    // Plot each pixel of the digit bitmap
    for (int digit_row = 0; digit_row < LETTER_SIZE; digit_row++) {
      for (int digit_col = 0; digit_col < LETTER_SIZE; digit_col++) {
        int color = digit_array[digit_row * LETTER_SIZE + digit_col];
        plot_pixel(
            num_start_col + digit_col + (LETTER_SIZE + MARGIN) * num_index,
            num_start_row + digit_row, color);
      }
    }
  }
  // swap front and back buffers on VGA vertical sync
  wait_for_vsync();
  // new back buffer
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
}

// plot one pixel given the coordinates and the color
void plot_pixel(int x, int y, short int line_color) {
  // get the address of the coordinate by shifting y by 10 and x by 1
  volatile short int* one_pixel_address =
      (short int*)(pixel_buffer_start + (y << 10) + (x << 1));
  // change the color of the pixel to the given color
  *one_pixel_address = line_color;
}

// plot the background of each word when the backspace is pressed
void plot_background() {
  for (int i = start_col + col * LETTER_SIZE + col * MARGIN;
       i < LETTER_SIZE + start_col + col * LETTER_SIZE + col * MARGIN; ++i) {
    for (int j = start_row + row * LETTER_SIZE + row * MARGIN;
         j < LETTER_SIZE + start_row + row * LETTER_SIZE + row * MARGIN; ++j) {
      // when the backspace is pressed then make the letter box into light gray
      plot_pixel(i, j, LIGHT_GRAY);
    }
  }
}

// draw the wordle board based on screen states
void draw_board() {
  wait_for_vsync();
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);

  for (int i = 0; i < X_SCREEN_SIZE; i++) {
    for (int j = 0; j < Y_SCREEN_SIZE; j++) {
      if (on_main_screen) {
        plot_pixel(i, j, main_screen[j * X_SCREEN_SIZE + i]);
      } else if (on_help_screen) {
        plot_pixel(i, j, help_screen[j * X_SCREEN_SIZE + i]);
      } else if (game_end) {
        plot_pixel(i, j, game_end_screen[j * X_SCREEN_SIZE + i]);
      } else if (game_scored) {
        plot_pixel(i, j, scored_screen[j * X_SCREEN_SIZE + i]);
      } else {  // else, game playing
        plot_pixel(i, j, dark_screen[j * X_SCREEN_SIZE + i]);
      }
    }
  }
  wait_for_vsync();
  *(pixel_ctrl_ptr + 1) = pixel_buffer_start;
}

// choose random word from word list
void choose_random_word() {
  // get a random number from 0 to number of words in the word list
  int num = rand() % (sizeof(wordlist) / sizeof(wordlist[0]));
  // copy the chosen random word into the answer
  strcpy(answer, wordlist[num]);
}

// find the next index of row and column
void find_next_index() {
  // increment column by 1 and if it exceeds 5 then return back to 0
  col = (col + 1) % 5;

  // only increment row if the column has reached the end
  if (col == 0) {
    // increment row by 1 and if it exceeds 6 then return back to 0
    row = (row + 1) % 6;
  }
}

// play background music
void play_audio() {
  struct audio_t* audio = (struct audio_t*)AUDIO_BASE;

  int sample_value = 0xFFFFFF;  // high amplitude
  int total_samples_for_note = 0;
  int samples_played_for_current_note = 0;
  int melody_index = 0;
  int half_period = SAMPLE_RATE / (melody[melody_index] * 2);  // half-period

  // Calculate total samples for the current note based on its duration
  total_samples_for_note =
      (SAMPLE_RATE * note_duration[melody_index]) / 1000;  // from ms to s

  while (1) {
    // if there's space in FIFO and sample cycle is not completed yet
    if (audio->wsrc > 0 &&
        samples_played_for_current_note < total_samples_for_note) {
      audio->ldata = sample_value;
      audio->rdata = sample_value;
      samples_played_for_current_note++;  // increment samples played
      if (samples_played_for_current_note % half_period == 0) {
        sample_value ^= 0xFFFFFF;  // toggle amplitude at each half period
      }
    }

    if (samples_played_for_current_note >= total_samples_for_note) {
      // if all samples played for current, move to next node in array
      melody_index = (melody_index + 1) % (sizeof(melody) / sizeof(melody[0]));
      half_period = SAMPLE_RATE / (melody[melody_index] * 2);
      total_samples_for_note =
          (SAMPLE_RATE * note_duration[melody_index]) / 1000;
      samples_played_for_current_note = 0;  // reset for next note
    }
  }
}

void interrupt_handler() {
  int ipending;

  NIOS2_READ_IPENDING(ipending);
  if (ipending & 0x80) {
    interval_PS2_ISR();  // IRQ 7
  }
  // else, ignore the interrupt
  return;
}

void interval_PS2_ISR() {
  int PS2_data, RVALID;
  char key = 0;
  int check_idx = -1;

  PS2_data = *(PS2_ptr);       // read the Data register in the PS/2 port
  RVALID = PS2_data & 0x8000;  // extract the RVALID field

  if (RVALID) {
    /* save the last three bytes of data */
    key = PS2_data & 0xFF;

    if (key == 0xF0) {
      return;
    }

    for (int i = 0; i < NUM_ALPHABET + 2; ++i) {
      if (key == ps2_key_hex[i]) {
        check_idx = i;
      }
    }

    if (check_idx != -1 && (skip_next == false)) {
      char text_input = alphabet[check_idx];

      if (on_main_screen || on_help_screen || game_end || game_scored) {
        // if enter is pressed
        if (key == 0x5A) {
        //   printf("Enter = %c \n", key);
          enter_press();
        }
        return;
      }

      // if enter is pressed
      if (key == 0x5A) {
        enter_press();
      }
      // if backspace is pressed (0x66)
      else if (key == 0x66) {
        backspace_press();
      }
      // other key is pressed
      else {
        // if a key was pressed then show the letter on the VGA
        show_letter(text_input);
      }

    } else if (skip_next == true) {
      skip_next = false;
    } else {
      skip_next = true;
    }
  }
}

// main function
int main() {
  // randomize time
  srand(1);

  // display initial score
  HEX_PS2();

  // choose random word from the word list
  choose_random_word();
  // set front pixel buffer to Buffer 1
  // first store the address in the back buffer
  *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
  // now, swap the front/back buffers, to set the front buffer location
  wait_for_vsync();
  // initialize a pointer to the pixel buffer, used by drawing functions
  pixel_buffer_start = *pixel_ctrl_ptr;
  // pixel_buffer_start points to the pixel buffer
  draw_board();

  // set back pixel buffer to Buffer 2
  *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
  // we draw on the back buffer
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  // pixel_buffer_start points to the pixel buffer
  draw_board();

  // initialize interrupt for keyboard
  *(PS2_ptr + 1) = 1;  // set RE to 1
  NIOS2_WRITE_IENABLE(0x80);
  NIOS2_WRITE_STATUS(1);

  while (true) {
    // always play music
    play_audio();
    // check keyboard press when game has not ended
    interrupt_handler();
    // check = keyboard_polling(check);
    // swap front and back buffers on VGA vertical sync
    wait_for_vsync();
    // new back buffer
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  }

  return 0;
}

/* SEVEN_SEGMENT_DECODE_TABLE gives the on/off settings for all segments in
a single 7-seg display in the DE1-SoC Computer, for the hex digits 0 - F */
void HEX_PS2() {
  unsigned char seven_seg_decode_table[] = {0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D,
                                            0x7D, 0x07, 0x7F, 0x67, 0x77, 0x7C,
                                            0x39, 0x5E, 0x79, 0x71};
  unsigned char hex_segs[] = {0, 0, 0, 0, 0, 0};
  int i;

  int temp_score = score;
  for (i = 0; i < 6; ++i) {
    hex_segs[i] = seven_seg_decode_table[temp_score % 10];
    temp_score /= 10;
  }
  /* drive the hex displays */
  *(HEX3_HEX0_ptr) = *(int*)(hex_segs);
  *(HEX5_HEX4_ptr) = *(int*)(hex_segs + 4);
}